import React, { useState } from "react";
import '../assets/styles/CareerBento.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMapMarkerAlt, faChartLine, faTools, faBookOpen, faAward, faImages } from '@fortawesome/free-solid-svg-icons';

// 1. Fix the missing imports/variables
const imgMumbai = require('../assets/images/1.png'); 
const imgNYC = require('../assets/images/2.png'); // Defining imgNYC here
const imgDegree = require('../assets/images/1.png'); // Temporary placeholder
const imgConvocation = require('../assets/images/2.png'); // Temporary placeholder

// 2. Define a strict Interface to satisfy TypeScript
interface CareerEntry {
  type: 'work' | 'education';
  org: string;
  title: string;
  location: string;
  date: string;
  logo: string;
  url: string;
  details: string[];
  // Optional fields
  impact?: string;
  tools?: string[];
  courses?: string[];
  achievements?: string[];
  gallery?: string[];
}

type EntryKey = 'mumbai_univ' | 'lti' | 'binghamton' | 'klaw';

function CareerBento() {
  const [activeTab, setActiveTab] = useState<EntryKey>('klaw');

  const careerData: Record<EntryKey, CareerEntry> = {
    mumbai_univ: {
      type: 'education',
      org: "University of Mumbai",
      title: "Bachelor of Engineering",
      location: "Mumbai, India",
      date: "2017 - 2021",
      logo: "https://medcounsel.in/PG/images/1642173662.png",
      url: "https://mu.ac.in/",
      gallery: [imgDegree, imgConvocation],
      courses: ["Data Structures", "Algorithms", "Operating Systems", "DB Management"],
      achievements: [
        "Social Media Head - Alumni Cell KJSCE",
        "Senior Photographer - KJSCE Shutterbugs",
        "Staff Writer & Photographer - Somaiya Voices",
        "Published Research Paper on Automated Systems"
      ],
      details: ["Major in Computer Engineering.", "First Class with Distinction."]
    },
    lti: {
      type: 'work',
      org: "LTIMindtree",
      title: "Software Engineer",
      location: "Mumbai, India",
      date: "2021 - 2023",
      logo: "https://companieslogo.com/img/orig/LTIM.NS-dea59dc6.png?t=1720244492",
      url: "https://www.ltimindtree.com/",
      impact: "65% Latency Reduction",
      tools: ["Spring Batch", "Drools", "SQL"],
      details: ["Optimized financial microservices.", "Modernized legacy PL/SQL systems."]
    },
    binghamton: {
      type: 'education',
      org: "Binghamton University",
      title: "Master of Science, CS",
      location: "New York, USA",
      date: "2023 - 2025",
      logo: "https://upload.wikimedia.org/wikipedia/en/6/67/State_University_of_New_York_at_Binghamton_Seal.png",
      url: "https://www.binghamton.edu/",
      gallery: [imgNYC], 
      courses: ["Data Science", "Cloud Computing", "Design Patterns", "Network Security"],
      achievements: ["Graduate Assistantship", "Maintaining 3.9+ GPA"],
      details: ["Specialization in Data Science.", "Hands-on experience with cloud-native architectures."]
    },
    klaw: {
      type: 'work',
      org: "KLAW Industries",
      title: "Software Engineer Intern",
      location: "Binghamton, NY",
      date: "2024 - 2025",
      logo: "https://images.squarespace-cdn.com/content/v1/5cfee7779de45a000197fd31/1622649420794-QC687JBOL698CEBAZOTH/KLAW+Industries+Transparent.png",
      url: "https://www.klawindustries.com/",
      impact: "40% Faster Ingestion",
      tools: ["AWS IoT", "Kinesis", "Linux"],
      details: ["Built real-time video pipelines.", "Managed multi-sensor telemetry."]
    }
  };

  const current = careerData[activeTab];

  return (
    <div className="career-dashboard-container" id="career">
      <h1>Experience & Education</h1>

      <div className="dashboard-wrapper">
        <div className="timeline-sidebar">
          {(Object.keys(careerData) as EntryKey[]).map((key) => (
            <div 
              key={key} 
              className={`timeline-nav-item ${activeTab === key ? 'active' : ''}`}
              onClick={() => setActiveTab(key)}
            >
              <div className="indicator"></div>
              <div className="nav-label">
                <span className="nav-date">{careerData[key].date}</span>
                <span className="nav-org">{careerData[key].org.split(' ')[0]}</span>
              </div>
            </div>
          ))}
        </div>

        <div className="main-display">
          <div className="display-card">
            <div className="card-header">
              <a href={current.url} target="_blank" rel="noopener noreferrer">
                <img src={current.logo} alt="Logo" className="company-logo" />
              </a>
              <div className="title-group">
                <h2>{current.org}</h2>
                <h3>{current.title}</h3>
                <p><FontAwesomeIcon icon={faMapMarkerAlt} /> {current.location}</p>
              </div>
            </div>

            <div className="card-body-grid">
              {current.type === 'education' ? (
                <>
                  <div className="info-box courses">
                    <label><FontAwesomeIcon icon={faBookOpen} /> Relevant Coursework</label>
                    <div className="pill-container">
                      {current.courses?.map((c: string) => (
                        <span key={c} className="pill education">{c}</span>
                      ))}
                    </div>
                  </div>
                  <div className="info-box gallery-preview">
                    <label><FontAwesomeIcon icon={faImages} /> Document Preview</label>
                    <div className="photo-stack">
                      {current.gallery?.map((img: string, i: number) => (
                        <img key={i} src={img} alt="Degree" className={`stack-img img-${i}`} />
                      ))}
                    </div>
                  </div>
                  <div className="info-box full-width">
                    <label><FontAwesomeIcon icon={faAward} /> Key Achievements</label>
                    <ul className="achievements-list">
                      {current.achievements?.map((a: string, i: number) => (
                        <li key={i}>{a}</li>
                      ))}
                    </ul>
                  </div>
                </>
              ) : (
                <>
                  <div className="info-box impact">
                    <label><FontAwesomeIcon icon={faChartLine} /> Impact</label>
                    <p>{current.impact}</p>
                  </div>
                  <div className="info-box expertise">
                    <label><FontAwesomeIcon icon={faTools} /> Expertise</label>
                    <div className="pill-container">
                      {current.tools?.map((t: string) => (
                        <span key={t} className="pill">{t}</span>
                      ))}
                    </div>
                  </div>
                  <div className="info-box full-width">
                    <label>Description</label>
                    <ul>
                      {current.details.map((d: string, i: number) => (
                        <li key={i}>{d}</li>
                      ))}
                    </ul>
                  </div>
                </>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CareerBento;
